/*
This code is performing a calculation of the Lyapunov exponent. The Lyapunov 
exponent is a measure of the rate of separation of infinitesimally close 
trajectories in a dynamic system, and is often used to quantify the level of 
chaos in a system.

When trading, the Lyapunov exponent can be used as an indicator 
of market volatility and predictability. 

A high value of the Lyapunov exponent can indicate a high degree of 
volatility and unpredictability in the market, which could indicate a trend 
reversal or market crash. I

A low value of the Lyapunov exponent can indicate a low degree of 
volatility and predictability in the market, which could indicate a stable market.
*/
const math = require('mathjs');
let candle = record.current
let len = 50

//Input 
let src = candle.close

variable.srcArray.push(src)
if (variable.srcArray.length > len) { variable.srcArray.splice(0, 1) }

if (variable.srcArray.length > len - 5) {

  // Normalize data to have zero mean and unit variance
  let mean = math.mean(variable.srcArray);
  let std = math.std(variable.srcArray);
  let normalizedData = variable.srcArray.map(val => (val - mean) / std);

  // Parameters for the algorithm
  let m = 3; // initial embedding dimension
  let tau = 1; // initial time delay
  let windowSize = 10; // rolling window size

  let N = normalizedData.length;
  let d = new Array(N - (m - 1) * tau);

  // Calculating distance
  for (let i = 0; i < d.length; i++) {
    let x = normalizedData.slice(i, i + (m - 1) * tau);
    let y = normalizedData.slice(i + tau, i + (m - 1) * tau + tau);
    d[i] = math.norm(math.subtract(x, y));
  }

  let threshold;
  // Adaptive loop to determine threshold, tau and m
  for (let i = 0; i < d.length; i++) {
    let subarray = d.slice(Math.max(i - windowSize, 0), i);
    let mean_distance, std_distance, cv;
    if (subarray.length === 0) {
      mean_distance = 0;
      std_distance = 0;
      cv = 0;

    } else {
      mean_distance = math.mean(subarray);
      std_distance = math.std(subarray);
      cv = (std_distance / mean_distance) * 100;
    }
    threshold = mean_distance + cv;

    // Adding +1 to tau and m
    for (let j = windowSize; j < N; j++) {
      let std_distance = math.std(d.slice(j - windowSize, j));
      if (std_distance > threshold) {
        tau++;
        m++;
        if (N - (m - 1) * tau < 1) {
          // Handle the case where N is less than 1 (for example, by breaking out of the loop)
          break;
        } else {
          d = new Array(N - (m - 1) * tau);
        }
        N = d.length

        // Recalculate distance
        for (let k = 0; k < N; k++) {

          let x = normalizedData.slice(k, k + (m - 1) * tau);
          let y = normalizedData.slice(k + tau - 1, k + (m - 1) * tau + tau - 1);

          d[k] = math.norm(math.subtract(x, y));
        }
      }
    }
  }

  // Calculate the Lyapunov exponent
  variable.lyapunovExponent = math.divide(math.log(math.mean(d)), tau);
}

variable.leArray.push(variable.lyapunovExponent)
if (variable.leArray.length > len) { variable.leArray.splice(0, 1) }

let func = dynamicLimits(variable.leArray, 30)
variable.upper = func.upper
