function dynamicLimits(signal, period) {
  // Initialize variables for the EMA and the standard deviation
  var ema = signal[0];
  var sumSquared = 0;
  var standardDeviation = 0;

  // The weighting factor (alpha) for the EMA
  var alpha = 2 / (period + 1);

  // Loop through the signal data and calculate the EMA and standard deviation
  for (var i = 0; i < signal.length; i++) {
    if (i > 0) {
      // Calculate the EMA for the current data point
      ema = (signal[i] - ema) * alpha + ema;

      // Sum the squared values of the data points for the standard deviation
      sumSquared += Math.pow(signal[i] - ema, 2);
    }

    // Calculate the standard deviation
    var variance = sumSquared / (i + 1);
    standardDeviation = Math.sqrt(variance);

    // Calculate the volatility-based threshold
    var threshold = 2 * standardDeviation;
  }
  return { upper: ema + threshold, lower: ema - threshold }
}

/*
 Daubechies Wavelet Oscillator /w Laguerre filter
*/
const math = require('mathjs');
let candle = record.current
let len = 50 // min 5.

//Settings for RSD t-test
let F = 24 //periods for fast component slope
let S = 64 //periods for slow component slope
let Fm = 24
let Sm = 64

//Setting for Laguerre Filter
let G = 0.5 //Laguerre damping factor 

//Input 
let src = candle.close

variable.srcArray.push(src)
if (variable.srcArray.length > len) { variable.srcArray.splice(0, 1) }


//Daubechies Wavelet Oscillator
//
let lastestVal = 0
if (variable.srcArray.length > 5) {
  //Decomposition using D4 wavelet
  let decomp = decomposition(variable.srcArray, "D4"); // 'D4', 'D6' or 'D8'
  //Detrend, keep the oscillations
  let detrendDecomp = detrendedDecomposition(decomp);
  //Denoise, clean the signal
  let denoiseDecomp = denoiseDecomposition(detrendDecomp)
  let denoised = recomposeData(denoiseDecomp)
  lastestVal = denoised[denoised.length - 1]
  // Z score normalization
  variable.denoiseArray.push(lastestVal)
  if (variable.denoiseArray.length > len) { variable.denoiseArray.splice(0, 1) }

  variable.dwo = zNormalization(variable.denoiseArray)
}

//RSD t-test 
//Code by Thomas Hault
//
variable.closeS.push(variable.dwo)
if (variable.closeS.length > S) {
  variable.closeS.splice(0, 1)
}

variable.closeF.push(variable.dwo)
if (variable.closeF.length > F) {
  variable.closeF.splice(0, 1)
}
//slow component slope calculation
if (variable.closeS.length === S) {
  //Mean of x and y 
  variable.sumx = 0
  variable.sumy = 0
  variable.SQx = 0
  variable.SQy = 0
  variable.CV = 0
  for (var i = 0; i < S; i++) {
    variable.sumx += i
    variable.sumy += variable.closeS[i]
  }
  variable.meanX = variable.sumx / F
  variable.meanY = variable.sumy / F
  //Standard deviation for x and y
  for (var i = 0; i < S; i++) {
    variable.SQx += Math.pow(i - variable.meanX, 2)
    variable.SQy += Math.pow(variable.closeS[i] - variable.meanY, 2)
  }
  variable.sX = Math.sqrt(variable.SQx / S)
  variable.sY = Math.sqrt(variable.SQy / S)
  //covariance between x and y 
  for (var i = 0; i < S; i++) {
    variable.CV += (i - variable.meanX) * (variable.closeS[i] - variable.meanY)
  }
  variable.cov = variable.CV / S
  variable.slowS = variable.cov / (variable.SQx * variable.SQy) * (variable.SQy / variable.SQx)
} else {
  variable.slowS = 0
}

//fast component slope calculation
if (variable.closeF.length === F) {
  //Mean of x and y 
  variable.sumx = 0
  variable.sumy = 0
  variable.SQx = 0
  variable.SQy = 0
  variable.CV = 0
  for (var i = 0; i < F; i++) {
    variable.sumx += i
    variable.sumy += variable.closeF[i]
  }
  variable.meanX = variable.sumx / F
  variable.meanY = variable.sumy / F
  //Standard deviation for x and y
  for (var i = 0; i < F; i++) {
    variable.SQx += Math.pow(i - variable.meanX, 2)
    variable.SQy += Math.pow(variable.closeF[i] - variable.meanY, 2)
  }
  variable.sX = Math.sqrt(variable.SQx / S)
  variable.sY = Math.sqrt(variable.SQy / S)
  //covariance between x and y 
  for (var i = 0; i < F; i++) {
    variable.CV += (i - variable.meanX) * (variable.closeF[i] - variable.meanY)
  }
  variable.cov = variable.CV / F
  variable.fastS = variable.cov / (variable.SQx * variable.SQy) * (variable.SQy / variable.SQx)
} else {
  variable.fastS = 0
}

//store slow component slope
variable.allSlow.push(variable.slowS)
if (variable.allSlow.length > Sm) {
  variable.allSlow.splice(0, 1)
}
//store fast component slope
variable.allFast.push(variable.fastS)
if (variable.allFast.length > Fm) {
  variable.allFast.splice(0, 1)
}

//calculate mean and standard deviation of slow slope
if (variable.allSlow.length === Sm) {
  variable.sum = 0
  variable.SQ = 0
  for (var i = 1; i < Sm; i++) {
    variable.sum += variable.allSlow[i]
  }
  variable.meanS = variable.sum / Sm
  for (var i = 1; i < Sm; i++) {
    variable.SQ += Math.pow(variable.allSlow[i] - variable.meanS, 2)
  }
  variable.stdS = Math.sqrt(variable.SQ / Sm)
} else {
  variable.stdS = 1
  variable.meanS = 1
}

//calculate mean and standard deviation of fast slope
if (variable.allFast.length === Fm) {
  variable.sum = 0
  variable.SQ = 0
  for (var i = 1; i < Fm; i++) {
    variable.sum += variable.allFast[i]
  }
  variable.meanF = variable.sum / Fm
  for (var i = 1; i < Fm; i++) {
    variable.SQ += Math.pow(variable.allFast[i] - variable.meanF, 2)
  }
  variable.stdF = Math.sqrt(variable.SQ / Fm)
} else {
  variable.stdF = 1
  variable.meanF = 1
}

variable.t_test = (variable.meanF - variable.meanS) / Math.sqrt((variable.stdF * variable.stdF) / Fm + (variable.stdS * variable.stdS) / Sm)

//Laguerre Filter
//Code by Thomas Hault, modified for this purpose
//
//Input signal
let signal = variable.dwo

//Previous Laguerre coef init
variable.pL0 = isFinite(variable.pL0) ? variable.pL0 : 0
variable.pL1 = isFinite(variable.pL1) ? variable.pL1 : 0
variable.pL2 = isFinite(variable.pL2) ? variable.pL2 : 0
variable.pL3 = isFinite(variable.pL3) ? variable.pL3 : 0

//Laguerre coefficient calculation
variable.L0 = (1 - G) * signal + G * variable.pL0
variable.L1 = - G * variable.L0 + variable.pL0 + G * variable.pL1
variable.L2 = - G * variable.L1 + variable.pL1 + G * variable.pL2
variable.L3 = - G * variable.L2 + variable.pL2 + G * variable.pL3

variable.dwoFilter = (variable.L0 + 2 * variable.L1 + 2 * variable.L2 + variable.L3) / 6

//update previous values
variable.pL0 = variable.L0
variable.pL1 = variable.L1
variable.pL2 = variable.L2
variable.pL3 = variable.L3


//if not finite -> 0

variable.dwo = isFinite(variable.dwo) ? variable.dwo : 0
variable.t_test = isFinite(variable.t_test) ? variable.t_test : 0
variable.dwoFilter = isFinite(variable.dwoFilter) ? variable.dwoFilter : 0


//Functions
function daubechies(n, waveletType) {
  if (n < 0) {
    console.log("Invalid value for n. Please choose a non-negative integer.")
    return;
  }
  switch (waveletType) {
    case 'D4':
      if (n === 0) {
        return [
          0.4829629131445341,
          0.8365163037378077,
          0.2241438680420134,
          -0.1294095225512603
        ];
      } else {
        const f = daubechies(n - 1, waveletType);
        return [f[0], math.add(f[0], math.multiply(f[1], 1)), f[1], math.add(f[2], math.multiply(f[3], 1)), f[3]];

      }
    case 'D6':
      if (n === 0) {
        return [
          0.3326705529500825,
          0.8068915093110924,
          0.4598775021184914,
          -0.1350110200102546,
          -0.0854412738820267,
          0.0352262918857095
        ];
      } else {
        const f = daubechies(n - 1, waveletType);
        return [f[0], math.add(f[0], math.multiply(f[1], 1)), f[1], math.add(f[2], math.multiply(f[3], 1)), f[3], math.add(f[4], math.multiply(f[5], 1)), f[5]];
      }
    case 'D8':
      if (n === 0) {
        return [
          0.2303778133088964,
          0.7148465705529155,
          0.6308807679398587,
          -0.0279837694168599,
          -0.1870348117190931,
          0.0308413818355607,
          0.0328830116668852,
          -0.010597401785069
        ];
      } else {
        const f = daubechies(n - 1, waveletType);
        return [f[0], math.add(f[0], math.multiply(f[1], 1)), f[1], math.add(f[2], math.multiply(f[3], 1)), f[3], math.add(f[4], math.multiply(f[5], 1)), f[5], math.add(f[6], math.multiply(f[7], 1)), f[7]];
      }
    default:
      console.log("Invalid wavelet type. Please choose 'D4', 'D6', or 'D8'.")
      return;
  }
}

function decomposition(data, waveletType) {
  const n = Math.floor(Math.log2(data.length));
  var f = daubechies(n, waveletType);
  let low = []
  let high = []
  for (let i = 0; i < data.length - 1; i += 2) {
    low.push(data[i] * f[0] + data[i + 1] * f[1]);
    high.push(data[i] * f[2] + data[i + 1] * f[3]);
  }
  return {
    low,
    high
  };
}

function denoiseDecomposition(decomposition) {
  let high = decomposition.high.map(x => x - math.mean(decomposition.high));
  return { high, low: decomposition.low };
}

function detrendedDecomposition(decomposition) {
  let low = decomposition.low.map(x => x - math.mean(decomposition.low));
  return { low, high: decomposition.high };
}

function recomposeData(decomposition) {
  let low = decomposition.low;
  let high = decomposition.high;
  let recomposedData = []
  for (let i = 0; i < low.length; i++) {
    recomposedData.push(low[i] + high[i]);
  }
  return recomposedData;
}

//Z-Normalization
function zNormalization(values) {
  let len = values.length
  let sum = 0
  let SQ = 0

  for (var i = 0; i < len; i++) {
    sum += values[i]
  }
  let MA = sum / len

  for (var i = 0; i < len; i++) {
    SQ += (values[i] - MA) ** 2
  }
  let sigma = Math.sqrt(SQ / len)

  return (values[values.length - 1] - MA) / sigma
}

